// HasConfig applies the HasEdge predicate on the "config" edge.
func HasConfig() predicate.PipelineVersion {
	return predicate.PipelineVersion(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, ConfigTable, ConfigColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasConfigWith applies the HasEdge predicate on the "config" edge with a given conditions (other predicates).
func HasConfigWith(preds ...predicate.PipelineConfig) predicate.PipelineVersion {
	return predicate.PipelineVersion(func(s *sql.Selector) {
		step := newConfigStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.PipelineVersion) predicate.PipelineVersion {
	return predicate.PipelineVersion(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.PipelineVersion) predicate.PipelineVersion {
	return predicate.PipelineVersion(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.PipelineVersion) predicate.PipelineVersion {
	return predicate.PipelineVersion(sql.NotPredicates(p))
}
